func loadDefaultGenesis(genesis *Genesis, testnet bool) error {
	if testnet {
		return json.Unmarshal([]byte(defaultTestnetGenesis), genesis)
	}
	return json.Unmarshal([]byte(defaultMainnetGenesis), genesis)
}

func DefaultTestnetGenesis(genesis *Genesis) error {
	return loadDefaultGenesis(genesis, true)
}

func DefaultMainnetGenesis(genesis *Genesis) error {
	return loadDefaultGenesis(genesis, false)
}
